import React from "react";

import ImreactCarousel from "imreact-carousel";
import "imreact-carousel/dist/index.css";

export default function Carrousel() {
    const bgList = [
        { id: 1, image: "../assets/images/logo.png" },
        { id: 2, image: "../assets/images/leaf.png" },
        { id: 3, image: "../assets/images/img1.png" },
    ];

    const carouselData = bgList.map((row) => {
        return {
            key: String(row.id),
            children: (
                <div
                    style={{
                        backgroundImage: `url(${row.image})`,
                    }}
                />
            ),
        };
    });

    return (
        <ImreactCarousel
            isDebug={true}
            isEnablePagination={true}
            data={carouselData}
            slidesPerView={1}
            slidesPerGroup={1}
        />
    );
}
